import React from 'react';


import AddEmployeeModal from './addEmployeeModal.jsx';

const ModalConductor = props => {
  console.log(this.props);
  switch (props.type) {
    case 'ADD_EMPLOYEE':
      return <AddEmployeeModal props = {props} />;
    default:
      return null;
  }
};

export default ModalConductor;
